"use strict";(self.webpackChunkdata_and_analytics=self.webpackChunkdata_and_analytics||[]).push([[1883],{3067:e=>{e.exports=JSON.parse('{"label":"3 | Preparing the data","permalink":"/tags/3-preparing-the-data","allTagsPath":"/tags","count":6,"items":[{"id":"book/chapter3/03-04-prepare-2","title":"3.4 | Preparing the product dimension (dimProduct)","description":"In this chapter we continue with preparing the product dimension dimProduct. For this table, some transformation steps are the same as for dimCustomer (in general you will notice over time that there is a certain set of transformations that is relevant for almost all data tables). Some transformation steps are new and will broaden your understanding of Power Query.","permalink":"/3.4"},{"id":"book/chapter3/03-05-prepare-3","title":"3.5 | Preparing the sales channel dimension (dimSalesChannel)","description":"The sales channel dimension dimSalesChannel is only a small table and there are not many transformation steps required to prepare it for the data model. All the operations used have been shown before and thus I will keep this chapter short.","permalink":"/3.5"},{"id":"book/chapter3/03-06-prepare-4","title":"3.6 | Preparing the date dimension (dimDate)","description":"The final dimension table to be prepared is one that is likely shared among nearly all existing business intelligence solutions worldwide: the date dimension.","permalink":"/3.6"},{"id":"book/chapter3/03-07-prepare-5","title":"3.7 | Preparing the sales fact table (factSales)","description":"After preparing the dimension tables, we can now continue with the fact tables for the sales transactions and the sales forecast. Remember, a fact table contains transactional data telling us what has happened when. With the associated dimensions we can describe what has happened in the facts by filtering, slicing and aggregating fact data.","permalink":"/3.7"},{"id":"book/chapter3/03-08-prepare-6","title":"3.8 | Preparing the sales forecast fact table (factForecast)","description":"In the previous chapter we prepared the fact table factSales which contains the actual sales transactions that happened over time. In many real-world use-cases plan data is integrated in the BI solution in order to allow comparisons and better judge performance.","permalink":"/3.8"},{"id":"book/chapter3/03-09-prepare-7","title":"3.9 | Organizing Power Query and loading data to the data model","description":"In the previous chapters we prepared all dimension and fact tables. In this final chapter for data preparation, we want to tidy up Power Query and load the data to the data model.","permalink":"/3.9"}]}')}}]);